import React, {useState} from "react";

function Authenticated({ loggedIn }) {
    const [ authenticated, setAuthenticated ] = useState(null)
    setAuthenticated(loggedIn)
    return (
        <div>
            <p>{loggedIn}</p>
            <p>{authenticated}</p>
        </div>
    )
}

export default Authenticated
